import axios from 'axios';
import { getEnvironmentData, resourceLimits } from 'worker_threads';

export const ApiGet_Simple = (URL:string):any => {
    axios
        .get(URL)
        .then((results) => {
            console.log(results.data);
            const getData = results.data;
            return(
                <div>
                    {getData}
                </div>
            )
        })
        .catch((error) => {
            console.log('通信失敗');
            console.log(error.status);
            return 
    });
};

